$_MODULE['<{ets_cfultimate}prestashop>help_55deac9cea67b28b657a3414d491a1e5'] = 'Kontaktformulare';
$_MODULE['<{ets_cfultimate}prestashop>help_e78f8e3951507d3ad70bad04d263a0f6'] = 'Wenn Sie beim Erstellen eines neuen Kontaktformulars auf den Link [1]„Neues Eingabefeld/Zeile hinzufügen, um Ihr Kontaktformular zu erstellen“[/1] klicken und ein Eingabefeld auswählen, wird dieses Eingabefeld standardmäßig auf ein vollständiges Feld gesetzt. Breite Zeile (1 Spalte)';
$_MODULE['<{ets_cfultimate}prestashop>help_44bc6f8a71dc89fff236e12f6f869244'] = 'Um das reCAPTCHA-Eingabefeld hinzuzufügen, müssen Sie zuerst reCAPTCHA aktivieren. Navigieren Sie zu [1]\"Einstellungen > Integration > reCAPTCHA\"[/1], aktivieren Sie die reCAPTCHA-Option und geben Sie Ihr Schlüsselpaar ein.';
$_MODULE['<{ets_cfultimate}prestashop>help_fde06cf9e07c495e4089187d22fe1f8b'] = 'Wie Sie den reCAPTCHA-Site-Key und den Secret-Key erhalten, erfahren Sie in unserer Moduldokumentation';
$_MODULE['<{ets_cfultimate}prestashop>help_f9654c9df3f610569dd727b769581e6f'] = 'Um Kundennachrichten direkt im Backoffice beantworten zu können, benötigen Sie Ihre Kunden-E-Mail-Adresse. Stellen Sie beim Erstellen eines Kontaktformulars sicher, dass Sie ein E-Mail-Eingabefeld hinzufügen und es als erforderliches Feld markieren.';
$_MODULE['<{ets_cfultimate}prestashop>help_df8334930ebd39a1c1bd49057ddb3586'] = 'E-Mail-Konfigurationen';
$_MODULE['<{ets_cfultimate}prestashop>help_439cf3a9e0342a20b68fcded2619e240'] = 'Um die Informationen aus Ihrem Kontaktformular an die E-Mail zu senden, die an den Administrator oder die Autoresponder-E-Mail gesendet wird, kopieren Sie bitte die entsprechenden E-Mail-Tags und fügen Sie sie in das Feld [1]„Nachrichtentext“[/1] in [1]„Kontaktformulare > E-Mail“[/1] ein Unterregister';
$_MODULE['<{ets_cfultimate}prestashop>help_853b64314f465e7a1ebc1c63287ac7f1'] = 'Um eine Anhangsdatei von Ihrem Kunden per E-Mail zu erhalten, navigieren Sie bitte zu [1]„Kontaktformulare > E-Mail“[/1] und aktivieren Sie das Kontrollkästchen [1]„Dateianhang“[/1].';
$_MODULE['<{ets_cfultimate}prestashop>help_7f83c7fcf109140ce437c3822fa1ce7a'] = 'Um Dateianhänge von Ihrem Kunden über die Registerkarte „Nachrichten“ zu erhalten, navigieren Sie bitte zu [1]„Kontaktformulare > Einstellungen“[/1] und aktivieren Sie die Option [1]„Anhänge speichern“[/1].';
